import React, {useState} from 'react'
import { AppBar, IconButton } from '@mui/material'
import Box from '@mui/material/Box'
import Toolbar from '@mui/material/Toolbar'
import Typography from '@mui/material/Typography'
import Button from '@mui/material/Button'
import Avatar from '@mui/material/Avatar'
import { Link } from "react-router-dom"
import Menu from '@mui/material/Menu'
import Container from '@mui/material/Container'
import HomeIcon from '@mui/icons-material/Home'
import Tooltip from '@mui/material/Tooltip';
import GroupsIcon from '@mui/icons-material/Groups';
import LocalShippingIcon from '@mui/icons-material/LocalShipping';
import NotesIcon from '@mui/icons-material/Notes';
import ShowChartIcon from '@mui/icons-material/ShowChart';
import AutoStoriesIcon from '@mui/icons-material/AutoStories';
import ScienceIcon from '@mui/icons-material/Science';
import MenuIcon from '@mui/icons-material/Menu';
import MenuItem from '@mui/material/MenuItem';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import {Drawer} from "@mui/material";
import MuiDrawer from "./MuiDrawer";
import AnnouncementIcon from '@mui/icons-material/Announcement';
import FactCheckIcon from '@mui/icons-material/FactCheck';
import RuleIcon from '@mui/icons-material/Rule';
import DesignServicesIcon from '@mui/icons-material/DesignServices';

const Appbar = () => {

  return (
    <div className="AppBar">
    <Box sx={{flexGrow: 1 }}>
      <AppBar position="static" color="transparent">
            <Container maxWidth="x1">
            <Toolbar disableGutters >

          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            Virginia Sage
          </Typography>
           <Button title="The Problem with CS Careers" href="/#problem" color='inherit' startIcon={<AnnouncementIcon/>}>The Problem</Button>
          <Button title="Our Solution" href="/#solution" color='inherit'><FactCheckIcon title="Team Bio" sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />The Solution</Button>
          <Button title="Meet the Team!" href="/team" color='inherit'><GroupsIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />Team</Button>
          <Button title="Feasibility Studies and Reports" href="/feasibility" color='inherit'><ScienceIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />Feasibility</Button>
          <Button title="Design Documents and Reports" href="/references"><ShowChartIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />Design</Button>
          <Button title="Mockups and Prototype Progress" href="/labs"><ScienceIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />Prototype</Button>
          <Button title="" href="/references"><AutoStoriesIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />Labs</Button>
          <Button href="/references"><AutoStoriesIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />References</Button>
          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>

          </Box>
          <Typography
            variant="h5"
            noWrap
            component="a"
            href=""
            sx={{
              mr: 2,
              display: { xs: 'flex', md: 'none' },
              flexGrow: 1,
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            Sage
          </Typography>
          <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
              <Button
                key="home"

                sx={{ my: 2, color: 'white', display: 'block' }}
              >
                Home
              </Button>
          </Box>
          <Box sx={{ flexGrow: 0 }}>
          <MuiDrawer/>
           </Box>
            </Toolbar>
            </Container>
        </AppBar>
    </Box>
    </div>
  )
}

export default Appbar
